import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for a product "Add to Cart" button (by text or class)
    // We'll use the first visible .add-to-cart button
    await page.waitForSelector('.add-to-cart', { timeout: 5000 });

    // Rapid Cart Manipulation Stress Test
    // Add the first product to cart 5 times rapidly
    for (let i = 1; i <= 5; i++) {
      const addToCartBtn = (await page.$$('.add-to-cart'))[0];
      await addToCartBtn.click();
      // Wait for notification to appear and disappear (if any)
      await page.waitForTimeout(200); // short pause for UI update
    }

    // Take screenshot after rapid adds
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_rapid_adds.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_rapid_adds.png'));

    // Open cart (look for .cart or Cart text)
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for cart modal to appear (look for #cartModal or .cart-item)
    await page.waitForSelector('.cart-item, .empty-cart', { timeout: 5000 });

    // Take screenshot of cart after adds
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_after_adds.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_after_adds.png'));

    // Rapidly increment and decrement quantity for the first cart item
    // Wait for quantity + and - buttons
    const plusBtn = await page.$('.cart-item .quantity-btn:nth-of-type(2)');
    const minusBtn = await page.$('.cart-item .quantity-btn:nth-of-type(1)');

    // Increase quantity 3 times
    for (let i = 0; i < 3; i++) {
      if (plusBtn) await plusBtn.click();
      await page.waitForTimeout(150);
    }

    // Decrease quantity 2 times
    for (let i = 0; i < 2; i++) {
      if (minusBtn) await minusBtn.click();
      await page.waitForTimeout(150);
    }

    // Take screenshot after quantity manipulation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_cart_after_quantity_change.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_cart_after_quantity_change.png'));

    // Remove the item from cart
    const removeBtn = await page.$('.cart-item .remove-item');
    if (removeBtn) {
      await removeBtn.click();
      await page.waitForTimeout(300);
    }

    // Take screenshot after removal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_cart_after_remove.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_cart_after_remove.png'));

    // Extract cart count from .cart (should be 0 or empty after removal)
    const cartDiv = await page.$('.cart');
    let cartCountText = '';
    if (cartDiv) {
      cartCountText = (await cartDiv.innerText()).replace(/\s+/g, ' ').trim();
    }

    // Extract if cart is empty
    let cartIsEmpty = false;
    const emptyCartEl = await page.$('.empty-cart');
    if (emptyCartEl) {
      cartIsEmpty = true;
    }

    return {
      success: true,
      action: "Performed rapid cart add, quantity change, and removal stress test. Verified cart count and empty state.",
      extractedData: {
        cartCountText,
        cartIsEmpty
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
